[Form]
public class RORVenueTable extends FormRun
{
    LogisticsEntityPostalAddressFormHandler postalAddressForm;
    TransDate systemDate;

}

public void init()
{
    super();

    systemDate = DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone());

    postalAddressForm = LogisticsEntityPostalAddressFormHandler::newParameters(venueTable_ds, logisticsEntityPostalAddressView_ds);

    FINDimValueController::setEditableDimensionSet(tableNum(RORVenueTable), DimensionEntryControl);
}

public int active()
{
    int ret = super();
    ;

    if(ret)
    {
        VenueTable_ds.updateDesign();
    }

    return ret;
}

public void updateDesign()
{
    VenueTable_ds.object(fieldNum(RORVenueTable, WPPProjId)).allowEdit(VenueTable.WPPIsRentalProject);

    boolean isActive = true;

    if((VenueTable.StartDate && VenueTable.StartDate > systemDate)
    || (VenueTable.EndDate && VenueTable.EndDate < systemDate))
    {
        isActive = false;
    }

    GroupNew.enabled(isActive);
}

public Common resolveReference(FormReferenceControl _formReferenceControl)
{
    Common ret;

    ret = super(_formReferenceControl);

    if (!ret.RecId || !HcmWorkerLookup::newOnlyActiveEmployeesWithinCompany().validateWorker(ret.RecId))
    {
        ret.clear();
    }

    return ret;
}

public void lookup(FormControl _formControl, str _filterStr)
{
    SysTableLookup          lookup;
    Query                   query;
    QueryBuildDataSource    qbds;
    QueryBuildRange         qbr;
    ;

    if(VenueTable.Segment)
    {
        query = new Query();
        qbds = query.addDataSource(tableNum(smmBusRelSubSegmentGroup));
        qbr = qbds.addRange(fieldNum(smmBusRelSubSegmentGroup, SegmentId));
        qbr.value(VenueTable.Segment);

        lookup = SysTableLookup::newParameters(tableNum(smmBusRelSubSegmentGroup), _formControl);
        lookup.parmQuery(query);
        lookup.addLookupfield(fieldNum(smmBusRelSubSegmentGroup, SubsegmentId), true);
        lookup.addLookupfield(fieldNum(smmBusRelSubSegmentGroup, SubsegmentDescription));
        lookup.performFormLookup();
    }
}

public void executeQuery()
{
    LogisticsEntityPostalAddressView::updateQuery(this.query().dataSourceName(this.name()), venueTable.RecId, LogisticsLocationEntityType::RORVenue);

    super();

    postalAddressForm.callerUpdateButtons(NewAddress, EditAddress, DeleteAddress, MapButton, DeactivateAddress, null, LogisticsEntityPostalAddressView.IsPrimary);
}

public int active()
{
    int ret;

    ret = super();

    postalAddressForm.callerActive();
    postalAddressForm.callerUpdateButtons(NewAddress, EditAddress, DeleteAddress, MapButton, DeactivateAddress, null, LogisticsEntityPostalAddressView.IsPrimary);

    return ret;
}

